import React from "react";
import "./ShowUsers.css";

export default function ShowUsers(props) {
  let list = props.Data;


  const content = 
    <div className="list">
      <ul>
        {list.map((val) => {
          return (
            <li>
              {val.username} ({val.age} Years old)
            </li>
          );
        })}
      </ul>
    </div>
  
  console.log(list);
  return (
    {content}
  );
}
